  import React, { useState } from "react";
import "./css/Menu.css";
import mylogo from "./img/logo2.png";
import { Link } from "react-router-dom";
import Modal from "react-modal";
import ModalLogin from "./Modal/ModalLogin";
import cancela from "./img/cancela.svg";
import Dialog from '@material-ui/core/Dialog';
import DialogActions from '@material-ui/core/DialogActions';
import DialogContent from '@material-ui/core/DialogContent';
import DialogTitle from '@material-ui/core/DialogTitle';
import Button from '@material-ui/core/Button';
import TextField from '@material-ui/core/TextField';
import PersonIcon from '@material-ui/icons/Person';
import Visibility from '@material-ui/icons/Visibility';
import VisibilityOff from '@material-ui/icons/VisibilityOff';
import Input from '@material-ui/core/Input';
import InputLabel from '@material-ui/core/InputLabel';
import IconButton from '@material-ui/core/IconButton';
import ArrowForwardIosIcon from '@material-ui/icons/ArrowForwardIos';
import InputAdornment from '@material-ui/core/InputAdornment';


function Menu() {
  const [Login, SetLogin] = useState(false);

  const handleClickShowPassword = () => {
  setValues({ ...values, showPassword: !values.showPassword });
};
const [values, setValues] = React.useState({
    amount: '',
    password: '',
    weight: '',
    weightRange: '',
    showPassword: false,
  });

  function HandleCloselogin(){
    SetLogin(false);
  }

  return (
    <nav className="poss">
      <div className="myMenu">
        <a className="pil pil_push" href="/">
          <img className="mylog" src={mylogo} width="80px" alt="" />
        </a>

        <div className="" id="navbarNav">
          <ul className="">
            <li className="">
              <Link className="pil" to="/">
                Home
              </Link>
            </li>
            <li className="">
              <a className="pil" href="/">
                Annonces
              </a>
            </li>
            <li className="">
              <a className="pil" href="/">
                About us
              </a>
            </li>
            <li className="">
              <a className="pil" href="/">
                Pricing
              </a>
            </li>
            <li className="Speciall">
              <button className="pil mycadr" onClick={() => SetLogin(true)}>
                Se connecter
              </button>

              <Dialog style={{marginLeft:'0%'}} fullWidth={false}  open={Login} onClose={HandleCloselogin} aria-labelledby="form-dialog-title" >
              <DialogTitle id="form-dialog-title">Sign Up</DialogTitle>
              <DialogContent>
              <div style={{display:'block'}}>
              <div>
                <TextField className={classes.margin} label="Login" width='50%' style={{margin:"0px 50px 10px 0px",width:'300px'}}
                    InputProps={{ startAdornment: ( <InputAdornment position="start"> <PersonIcon  /> </InputAdornment> ), }}
                /><br/>
                <InputLabel htmlFor="standard-adornment-password">Password</InputLabel>
                  <Input style={{margin:"0px 50px 10px 0px",width:'300px'}} id="standard-adornment-password" type={values.showPassword ? 'text' : 'password'} value={values.password}
                    endAdornment={
                      <InputAdornment position="end">
                        <IconButton aria-label="toggle password visibility" onClick={handleClickShowPassword} onMouseDown={handleMouseDownPassword}>
                          {values.showPassword ? <Visibility /> : <VisibilityOff />}
                        </IconButton>
                      </InputAdornment>}
                /><br/><br/>
                <Button variant="contained" style={{background:'#f96332', color:'white',width:'40%',marginLeft:'0%'}} className={classes.button} startIcon={<ArrowForwardIosIcon />}>
                  Sign Up
                </Button>
              </div><br/>
              </div>
              </DialogContent>
            </Dialog>

            {/*<Modal
              isOpen={modalIsOpen}
              style={{
                overlay: {
                  backgroundColor: "rgba(205, 205, 205, 0.719)",
                },
                content: {
                  width: "330px",
                  height: "400px",
                  margin: "auto",
                },
              }}
            >
                <div>
                  <button
                    className="tocloose"
                    onClick={() => setModalOpen(false)}
                  >
                    <img src={cancela} alt="" width="17px" />{" "}
                  </button>
                </div>

                <ModalLogin />
              </Modal>*/}
              &nbsp;
              <Link className="pil mycadr" to="/Inscription">
                S'inscrire
              </Link>
            </li>

            <li>
              <a className="pil mycadr" href="/">
                <div className="moncadr">
                  <p className="contentCadr">Publier annonce</p>
                </div>
              </a>
            </li>
          </ul>
        </div>
      </div>
    </nav>
  );
}

export default Menu;
